# -*- coding: utf-8 -*-

import subprocess, re, lzma, winsound
from base64 import b64decode
from pathlib import Path

def dash(path_str):
  path_str = path_str.strip("'").strip('"')
  p = Path(path_str)
  if p.exists() and p.is_dir():
    parent_path = str(p.parent.absolute())
    folder_name = p.parts[-1]
    print(folder_name)
    matched = re.search(r'^\[(\d{6})\]', folder_name, re.I)
    if matched:
      pwd = matched.group(1)
      opt = subprocess.run(rf'"c:\Program Files\WinRAR\rar.exe" a -m5 -o+ -hp{pwd} -s -r -rr3p -ep1 -t -oi -ma5 "{str(p)}.rar" "{str(p)}\*"')
      print(opt)
      winsound.PlaySound(file_like_obj, winsound.SND_MEMORY)
    else: print("Filename invalid.")
  else: print("Invalid path.")
  dash(input("Dir:\n"))

if __name__ == '__main__':
  file_like_obj = lzma.decompress(b64decode(''))
  dash(input("Dir:\n"))